import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const LoginScreen = () => {
    return (
        <View>
            <Text>Login Screen</Text>
        </View>
    )
}

export default LoginScreen

const styles = StyleSheet.create({})
